        // 检查当前网址是否匹配延时运行的网址列表
    function isDelayRunWeb() {
        const currentUrl = window.location.href;
        for (const DelayRun of DelayRunWeb) {
            if (currentUrl.includes(DelayRun)) {
                return true;
            }
        }
        return false;
    };


    // 移除元素
    function removeElements() {
        elementsToRemove.forEach(elementselector => {
            const elements = document.querySelectorAll(elementselector);
            elements.forEach(element => {
                element.remove();
            });
        });
    };


    //延迟移除元素
    function removeDelay(){
     document.addEventListener('DOMContentLoaded', () => {
       if (isDelayRunWeb()) {
        setTimeout(removeElements, delayTime3);
        setTimeout(removeElements, delayTime4);
        };
    });
        window.addEventListener('load', () => {
       if (isDelayRunWeb()) {
        setTimeout(removeElements, delayTime3);
        setTimeout(removeElements, delayTime4);
       };
    });

    }

    //设置清理元素的监听器
    document.addEventListener('DOMContentLoaded', () => {
       if (!isDelayRunWeb()) {
        removeElements();
        }else{removeDelay();}
    });
    window.addEventListener('load', () => {
        if (!isDelayRunWeb()) {
        removeElements();
        }else{removeDelay();}
    });






